#-----------------------------------------------Function

def input():
    global filePath, ex, timeRest, round, nbrEx
    filePath = filedialog.askopenfilename(filetypes=(("Training files", "*.csv"),("All files", "*.*")))
    if filePath!='':
        ex = []
        timeRest = []
        round = []
        with open(filePath, 'r', encoding='utf-8') as file:
            data = reader(file, delimiter=',')
            header = next(data)
            for row in data:
                if (row == header):
                    continue
                ex.append(row[0])
                round.append(row[1])
                timeRest.append(row[2])
        nbrEx = len(round)
        list = ""
        for x in ex:
            list += x
            list += "\n"
        lbList.configure(text=list)
        lbIcon.configure(text="Your exercises:")
        lb1.configure(text=ntpath.basename(filePath)[:-4])
        lb2.configure(text= str(nbrEx) + " exercises")
        lb3.configure(text="Ready?")
        start.configure(text="START!", command=begin)
    return

def nothing():
    return

def ringring():
    winsound.PlaySound(filename, winsound.SND_FILENAME)
    winsound.PlaySound(filename1, winsound.SND_FILENAME)
    return

def checkLog():
    global date, timeDure
    # Plot the bar graph
    converted_dates = dates.datestr2num([datetime.datetime.strptime(day, '%d/%m/%Y').strftime('%m/%d/%Y')
                                        for day in date])
    format = dates.DateFormatter('%d-%m-%Y')
    plot = plt.bar(converted_dates, timeDure)
    ax = plt.gcf().axes[0]
    ax.xaxis.set_major_formatter(format)
    plt.gcf().autofmt_xdate(rotation=25)

    plt.title("Your history")
    plt.xlabel("Date")
    plt.ylabel("Duration (mins)")
    plt.show()
    return

def updateTime():
    global filePath, dure
    dure +=1
    browse.configure(text=ntpath.basename(filePath)[:-4] + "     " + str(nEx+1) + "/" + str(nbrEx) + "     " + str(datetime.timedelta(seconds=dure)), font=("ds-digital",40),fg='cyan')
    window.after(1000, updateTime)
    return

def updateRest():
    global rest,ex, nEx, timeRest, nRound
    if rest >= 0:
        lb3.configure(text="Rest: " + str(rest), font=("ds-digital",35))
        rest -=1
        window.after(1000,updateRest)
    else:
        threadSound = Thread(target = ringring)
        threadSound.start()
        lb1.configure(text=ex[nEx])
        lb2.configure(text="Round: " + str(nRound) + "/" + str(round[nEx]))
        lb3.configure(text="Let's do it!", font=("Arial",35))
    return

def getRound(r=n, i=0):
    global round
    for i in range(0,len(round)):
        if (r - int(round[i])) <= 0:
            return r, i
        else:
            r -= int(round[i])
    return -1,(len(round)-1)

def done():
    global data, ex, timeRest, round, n, nRound, nEx, rest, log, logLoc
    if rest<0:
        n += 1
        nRound, nEx = getRound(r=n)
        if nRound>0:
            lb1.configure(text="Next: "+ex[nEx])
            lb2.configure(text="Next round: " + str(nRound) + "/" + str(round[nEx]))
            lb3.configure(text="Rest: " + str(timeRest[nEx]) , font=("ds-digital",35))

            rest = int(timeRest[nEx])
            updateRest()
        else:
            lb1.configure(text="")
            lb2.configure(text="GOOD JOB!", font=("Arial",35))
            lb3.configure(text="")
            start.configure(text="                 CLOSE                 ", command=window.destroy)
            log = time.strftime("%d/%m/%Y,%H:%M:%S,") + ntpath.basename(filePath)[:-4] + "," + str(dure)
            fileLog = open(logLoc, "a+")
            fileLog.write(log+"\n")
            fileLog.close()
    return

def begin():
    global data,ex,timeRest,round,n, nRound, nEx, start, filePath
    if (filePath != ''):
        browse.configure(command=nothing)
        n += 1
        lb1.configure(text=ex[nEx])
        lb2.configure(text="Round: "+ str(nRound) +"/"+str(round[nEx]), font=("ds-digital",35))
        lb3.configure(text="Next rest: "+str(timeRest[nEx]), font=("ds-digital",35))
        start.configure(text="                  DONE                  ",command=done)
        thread = Thread(target = updateTime)
        thread.start()
    return

