browse = Button(frame1, text="Chose your training program:", font=("Arial",40),fg='white',bg='gray', command=input)
browse.pack(fill='x')

start = Button(frame2, text="Check history of training", font=("Arial",40), fg='white',bg='gray',command=checkLog)
start.pack(fill='x')

window.mainloop()